create TABLE customer
(
    Id uniqueidentifier PRIMARY KEY,
    customerId nvarchar(15) not null,
    nickname nVARCHAR(50) NULL,
    gender int not null,
    birthdate DATETIME not null,
    photo NVARCHAR(max) null
)

