select * from bankaccount;
create table bankaccount
(
    Id uniqueidentifier primary key,
    customerId nVARCHAR(15) not null, 
    BankNumber int not null,
    AgencyNumber nvarchar(10) not null,
    VerifyingDigitAgency char(1) null,
    AccountNumber nvarchar(10) not null,
    VerifyingDigitAccount char(1) not null,
    MainBankAccount bit not null,
    BankAccountType int not null,
    CreationDate DATETIME not null
)

